description:
James is an English rock band from Manchester, formed in 1981. After an uphill struggle throughout the 1980s, it went on to become one of the most consistently successful acts of the 1990s, scoring a string of hit singles during the decade including &quot;Sit Down&quot; and &quot;Laid&quot;. Following the departure of lead singer Tim Booth in 2001, the band became inactive, although no split was ever officially confirmed. In January 2007, the group reformed for a nationwide tour and a new album, Hey Ma, was released in 2008, alongside the single &quot;Whiteboy&quot;.




